5b66859ba03de46ea04bbdc52caaefc2692994e4.message:
Introduce "strictMissingRequire" diagnostics.

This check fills the holes in the current "missingRequire" check. It reports when goog.module imports or references a legacy namespace indirectly through a namespace defined in separate file.

The three cases that were previously ignored in a goog.module were:

When parent namespace is imported, but a namespace provided in another file is referenced through the parent object (a missing require). const A = require('A'); ref(A.B);

When both namespace are imported but the namespace is referenced via the parent namespace object (wrong alias). const A = require('A'); const B = require('B'); ref(A.B);

When the child namespace is referenced via a destructuring import of the parent namespace (bad import). const {B} = require('A');

This introduces the check but it is disabled by default.

