3a9102e82ce428b70a839733078f037b9e74e5bb.message:
Move named functions to the top of the class static blocks during Normalization

RewriteClassMembers pass converts the class static blocks into a member functions. The nested function declarations inside those member functions must be hoisted in order to preserve normalization.

For example:
```
class C {
  static {
    const y = () => {return 2;}
    function a() {return 3;}
  }
}
```

gets rewritten by RewriteClassMembers pass to:

```
class C {
  /** @nocollapse */
  static STATIC$BLOCK$0() {
    const y = () => {
      return 2;
    };
    function a() {
      return 3;
    }
  }
}
C.STATIC$BLOCK$0();
```

which is unnormalized as the inner function a() is not hoisted.

