cb6581dc29b42c2631c3f5075857da8a1fa3c96d.message:
Move CCCM after late l10n

`CrossChunkCodeMotion` cannot move switch statements.

It only moves qualified name declarations and a couple of value-modifying function calls.

closure-library has a lot of locale-specific code in switch statements that look like this.

```javascript
switch (goog.LOCALE) {
  case 'en-US':
    some.global.value = 'en-US version of the value';
    break;

  case 'es-419':
    some.global.value = 'en-419 versin del valor';
    break;

  // etc.
}
```

After `goog.LOCALE` is replaced with a string constant,
the `peepholeOptimizations` pass can replace such statements with a single assignment,
which CCCM can then move.

So, we need to do CCCM and its related passes after that happens.

