e56c3b76ba95f9b18fc4d0aa2758407ce3b19211.message:
FlowSensitiveInlineVariables: Correct scope checking

Fix some cases where we would fail to inline variables declared
with `let` or `const` in a block scope.

The following code sample explains.

```javascript
function foo() {
  {
    const X = getX();

    // It's not OK to replace `q` with `X`, because `q`
    // can be referenced in places where `X` is out of scope.
    // This was already handled correctly.
    var q = X;

    // It's OK to replace `m` with `X`, because `X` is defined everywhere that
    // `m` is defined.
    // Prior to this change we checked for this incorrectly, by checking
    // whether `X` existed in the function scope, which it doesn't.
    // After this change, we check to see whether `X` exists in the scope that
    // declares `m`, which it does.
    let m = X;
    console.log(m);
  }
  return q;
}
```

